import React, {useState} from 'react';
import BorderRadius from './BorderRadius';
import '../scss/Editor.scss';

export default function Editor({colorRed}) {
    const [color, setColor] = useState("");

    const handleSetColor = (e) => {
        setColor(prevState => {
            return ([...prevState, e.target.value])
        })
    }
    return (
        <div>
            <div className='editor__inputs'>
                <div>
                    <h1>Wybierz kolor</h1>
                    <input type="color" id="color" onChange={handleSetColor}></input>
                    <h2>{color}</h2>
                </div>
                <div>
                    <h1>Wybierz wysokość</h1>
                    <h1>Wybierz szerokość</h1>
                </div>
                <BorderRadius></BorderRadius>
            </div>
            <button>SAVE</button>
        </div>
    )
}
